import { connect, useDispatch } from 'react-redux';
import { withRouter } from 'react-router-dom';
import mapStoreToProps from '../../../redux/mapStoreToProps';

function ThankYou(props) {

  let dispatch = useDispatch();

  const sendInfo = () => {
    dispatch({
      type: 'ADD_CUSTOMER',
      payload: props.store.customerInfo
    });
    dispatch({
      type: 'QUOTE_PROGRESS',
      payload: { divisor: 8, step_number: 0 }
    });
    props.history.push('/');
  };

  return (
    <div>

      <h2>Thank You</h2>
      <p>Thank you for submitting this form!</p>
      <button className='btn primary_btn' onClick={sendInfo}>Close Window</button>

    </div>
  );
}

export default connect(mapStoreToProps)(withRouter(ThankYou));
